	INSERT INTO public.cw_service (cser_id, cw_id, srv_id) VALUES(nextval('cw_service_cser_id_seq'::regclass), my_cw_id, 5);
	INSERT INTO public.cw_service (cser_id, cw_id, srv_id) VALUES(nextval('cw_service_cser_id_seq'::regclass), my_cw_id, 6);

	/*	Insertamos una reserva para el coworking creado*/
	INSERT INTO public.booking (bk_id, bk_usr_id, bk_cw_id, bk_state) VALUES(nextval('booking_bk_id_seq'::regclass), my_user, my_cw_id, true)
	returning bk_id INTO my_bk_id;

